// Add the following lines to scroll down when the page loads
window.onload = function() {
    window.scrollBy(100, 2000); // Adjust the value as needed
};


// Function to scroll down
function scrollToBottom() {
            window.scrollTo({
                top: document.body.scrollHeight,
                behavior: 'smooth'
            });
        }

        // Function to scroll up
        function scrollToTop() {
            window.scrollTo({
                top: 100,
                behavior: 'smooth'
            });
        }

        // Example: Scroll down after 2 seconds
        setTimeout(scrollToBottom, 2000);

        // Example: Scroll up after 4 seconds
        setTimeout(scrollToTop, 4000);